webpackJsonp([0x6256f73c51f2],{316:function(l,n){l.exports={data:{site:{siteMetadata:{title:":-)",author:"github.com/9renpoto"}},markdownRemark:{id:"/home/travis/build/9renpoto/entry/src/pages/2017-10-24-fullstack/index.md absPath of file >>> MarkdownRemark",html:"<h1>エンジニアにとっての集中と選択</h1>\n<ul>\n<li>\n<p>なんでも出来るようになったほうが良いのか</p>\n<ul>\n<li>現在の自分の選択は <code>No</code></li>\n</ul>\n</li>\n<li>1つのジャンルを勉強するだけで年中Githubの芝生を埋められる</li>\n<li>\n<p>リードできないと認められない</p>\n<ul>\n<li>仕事がなくなる</li>\n</ul>\n</li>\n<li>\n<p>経験者・未経験者・年齢関係なく今を勉強しないと使えない</p>\n<ul>\n<li>苦痛に感じたら向いてない</li>\n<li>立場ではない、出来る人がすごい</li>\n</ul>\n</li>\n</ul>\n<h2>過去の自分</h2>\n<ul>\n<li>\n<p>勉強会にいけば少しでも進歩出来ると思っていた</p>\n<ul>\n<li>完全に <code>No</code></li>\n<li>自分は頭が悪いので手を動かさないと身につかない</li>\n</ul>\n</li>\n<li>\n<p>輝かしい技術・アーキテクチャ</p>\n<ul>\n<li>流行り物は正義である</li>\n<li><code>Yes</code> もあり <code>No</code></li>\n<li>理解しなければ指を加えて見てるだけ</li>\n</ul>\n</li>\n</ul>\n<h2>仕事と自分</h2>\n<ul>\n<li>とりあえず無能さを痛感する毎日</li>\n</ul>\n<h2>とりあえず必死に生きる今</h2>\n<ul>\n<li>ビルドする</li>\n<li>破壊する</li>\n<li>書く、書き直す</li>\n<li>手札を増やす</li>\n<li>動かしてないものはいざとなったときに使えない</li>\n</ul>\n<h2>まとめ</h2>\n<ul>\n<li>たまにはまともと認められるコードを書きたい</li>\n<li>思想が間違っていないか議論したい</li>\n<li>メンターがいないしメンターとして認められるわけでもないのでモチベーションが厳しい</li>\n<li>過去の自分を否定するためにコードを書く</li>\n<li>すぐリードできなくなるので別のことを勉強する</li>\n</ul>",frontmatter:{title:"フルスタックと器用貧乏",date:"October 23, 2017"}}},pathContext:{path:"/entry/2017/10/24/full-stack-engineer/",_PARENT:"SOURCE"}}}});
